import PropTypes from 'prop-types';
import classNames from 'classnames';

class Form extends React.Component {
  static propTypes = {
    children: PropTypes.node.isRequired,
    className: PropTypes.string
  }

  render() {
    return (
      <form name='rsvp' method="POST" data-netlify="true" className={ this.props.className }>
        { this.props.children }
        <style jsx>{`
          form {
            display: flex;
            flex-direction: column;
            width: 600px;
            margin-bottom: 32px;
          }
          .form-split {
            display: flex;
          }
        `}</style>
      </form>
    )
  }

}

export default Form
